import "isomorphic-fetch"

export function postWriting(paragraph) {
    return fetch('http://35.194.72.130/api/addText', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ paragraph }) 
    })
}
